import React from 'react';
import './styles.css'
import Logo from '../../assets/img/Final-Fantasy-XIV-Logo.png'

function Nav(props) {
    return (
        <nav>
            <div className='container'>
                <div className='content'>
                    <div className='main-logo'><img src={Logo} alt="Logo" /></div>
                </div>
            </div>
        </nav>
    );
}

export default Nav;
